function Map() {

    let map = (
        <MapContainer
            center = {center}
            zoom={3}
            style={{ width: '100vw', height: '100vh'}}>
            <TileLayer
                url='https://api.maptiler.com/maps/basic-v2/256/{z}/{x}/{y}.png?key=c6mxawEM3vEsscv3fKMp'
